    // (4l)
    // >>> fib4((6l))
    // (8l)
    // >>> fib4((7l))
    // (14l)
    public static long fib4(long n) {
        if (n <= 3) {
            return 0;
        }
        long[] dp = new long[4];
        dp[0] = 0;
        dp[1] = 0;
        dp[2] = 2;
        dp[3] = 0;
        for (long i = 4; i <= n; i++) {
            dp[i % 4] = dp[(i - 1) % 4] + dp[(i - 2) % 4] + dp[(i - 3) % 4] + dp[(i - 4) % 4];
        }
        return dp[n % 4];

