    public static long modp(long n, long p) {
        if (n == 0) {
            return 1;
        }
        if (n == 1) {
            return 2;
        }
        if (n % 2 == 0) {
            return modp(n / 2, p) * modp(n / 2, p) % p;
        } else {
            return (modp(n - 1, p) * modp(n - 1, p) * 2) % p;
        }

