    // >>> minSubArraySum((new ArrayList<Long>(Arrays.asList((long)-1l, (long)-2l, (long)-3l))))
    // (-6l)
    public static long minSubArraySum(ArrayList<Long> nums) {
        long min = Long.MAX_VALUE;
        long sum = 0;
        for (int i = 0; i < nums.size(); i++) {
            sum += nums.get(i);
            if (sum < min) {
                min = sum;
            }
            if (sum - min > 0) {
                sum -= min;
                min = sum;
            }
        }
        return min;

